import { people } from "./DataList";
import React from 'react';
import ReactECharts from 'echarts-for-react';

const MyChart = () => {
  const ageDistribution = {};

  people.forEach(person => {
    if (ageDistribution[person.age]) {
      ageDistribution[person.age]++;
    } else {
      ageDistribution[person.age] = 1;
    }
  });

  const ages = Object.keys(ageDistribution).map(age => parseInt(age));
  const counts = Object.values(ageDistribution);

  const option = {
    title: {
      text: 'Altersverteilung',
      left: 'center',  // Zentriert den Titel horizontal
      top: 'top',      // Positioniert den Titel oben
      textStyle: {
        fontSize: 18, // Optional: Schriftgröße des Titels
        fontWeight: 'bold' // Optional: Schriftstärke des Titels
      }
    },
    tooltip: {},
    xAxis: {
      type: 'category',
      data: ages
    },
    yAxis: {
      type: 'value'
    },
    series: [
      {
        name: 'Anzahl Personen',
        type: 'bar',
        data: counts
      }
    ]
  };

  return <ReactECharts option={option} />;
};

export default MyChart;
